import React, { Component } from 'react';
import './App.css';
import ImageLinkForm from './components/ImageLinkForm/ImageLinkForm';
import Logo from './components/Logo/Logo';
import Navigation from './components/Navigation/Navigation';
import Rank from './components/Rank/Rank';
import ParticlesBg from 'particles-bg';
import Clarifai from 'clarifai'
import axios from 'axios';

const app = new Clarifai.App ({
  apiKey: '33ae34510ce844dd81ba2294c21d84c4'
})

class App extends Component {
  constructor() {
    super();
    this.state = {
      input: '',
    }
  }

  onInputChange = (event) => {
    console.log(event.target.value);
  }

  onButtonSubmit = async () => {
    console.log('click');
    try {
      const response = await app.models.predict("a403429f2ddf4b49b307e318f00e528b", this.state.input);
      console.log(response);
      // Use a resposta da API para exibir a imagem com a face marcada.
    } catch (error) {
      console.log(error);
    }
  }

  render() {
    return (
      <>
        <div className='App'>
          <Navigation />
          <Logo />
          <Rank />
          <ImageLinkForm 
            onInputChange={this.onInputChange} 
            onButtonSubmit={this.onButtonSubmit} 
          />
          {/* <FaceRecognition 
          /> */}
        </div>
        <div className='Particles'>
          <ParticlesBg type="cobweb" num={300} color='#ffffff' bg={true} />
        </div>
      </>
    );
  }
}

export default App;
